webpackJsonp([49997065172705],{306:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Annalisa Valente"}},contentfulPageSelectorPanel:{pages:[{name:"Macmillan Cancer Support",title:null,slug:"/projects/brave-the-shave/",description:"Redesigning Brave the Shave microsite"},{name:"Google",title:"Google",slug:"/projects/google/",description:"Interaction designer contractor in the Google Play Console team"},{name:"PD Spellbook",title:"PD Spellbook",slug:"/projects/pd-spellbook",description:"PD spellbook is a glossary of terms for product people"},{name:"Mighty hikes",title:null,slug:"/projects/mighty-hikes",description:"Discovering phase of a fundraising proposition"},{name:"The Telegraph",title:"The Telegraph",slug:"/projects/the-telegraph/",description:"Working on various digital newspaper touch points"},{name:"Local Cancer Intelligence",title:"Local Cancer Intelligence",slug:"/projects/local-cancer-intelligence/",description:"New filter system for the LCI website"},{name:"Nectar ",title:"Nectar",slug:"/projects/nectar/",description:"  New way of discovering Nectar brands for web and iOS-Android "},{name:"The Telegraph Puzzle ",title:null,slug:"/projects/the-telegraph-puzzle/",description:"Redesign the experience of the Telegraph Puzzle website"},{name:"MyMail & Nectar",title:"MyMail & Nectar",slug:"/projects/mymail-and-nectar/",description:"Launch of MyMail and Nectar proposition"},{name:"RememberÂ names",title:null,slug:"/projects/face-name/",description:"Concept of an Android experience that helps to match faces to names"},{name:"Mindfulness Moments",title:"Mindfulness Moments",slug:"/projects/mindfulness-moments/",description:"Building a new fundraising proposition"},{name:"Calvin Klein",title:"Calvin Klein",slug:"/projects/calvin-klein/",description:"Designing microsite for Calvin Klein Italy"},{name:"Emoji and depression",title:null,slug:"/projects/emoji-and-depression",description:"Detect depression in young people "}]},contentfulPage:{slug:"/projects/pd-spellbook",password:null,panels:[{__typename:"ContentfulHeaderPanel",text:"A glossary of terms for product people (Work in progress)"},{__typename:"ContentfulContentPanel",content:{content:"[This project](https://richard-cargill.github.io/pd-spellbook/) is still a work in progress.\nMost links don't work yet and there are bugs that we are fixing :D.\n\nWhat is this about?\n\nDesign is not only making things pretty.\nThere are a lot of things that go around the design process from identify user needs and defining problems to the launch of a product of a feature. And also after the launch there are other components involved. How do you know all the elements that are implicated in the process?\n\nI've collected most of the terms and useful links that I've came across during my career and I've decided to call it \"spellbook\" because it is a collection of terms to use in your everyday job as a designer or as a product person to make your magic happens.\n\nThis has multiple usages:\n\n- Junior people that approach the product/UX career\"\nYou are in a meeting and do people start to talk about some terms that you never heard about it? This is normal and it happens usually at the beginning of the career. \n\n- People that want to learn more about product:\nAre you interested to learn more about design, product, process and all the world around it?\n\n\n",childMarkdownRemark:{html:'<p><a href="https://richard-cargill.github.io/pd-spellbook/">This project</a> is still a work in progress.\nMost links don\'t work yet and there are bugs that we are fixing :D.</p>\n<p>What is this about?</p>\n<p>Design is not only making things pretty.\nThere are a lot of things that go around the design process from identify user needs and defining problems to the launch of a product of a feature. And also after the launch there are other components involved. How do you know all the elements that are implicated in the process?</p>\n<p>I\'ve collected most of the terms and useful links that I\'ve came across during my career and I\'ve decided to call it "spellbook" because it is a collection of terms to use in your everyday job as a designer or as a product person to make your magic happens.</p>\n<p>This has multiple usages:</p>\n<ul>\n<li>\n<p>Junior people that approach the product/UX career"\nYou are in a meeting and do people start to talk about some terms that you never heard about it? This is normal and it happens usually at the beginning of the career. </p>\n</li>\n<li>\n<p>People that want to learn more about product:\nAre you interested to learn more about design, product, process and all the world around it?</p>\n</li>\n</ul>'}}}]}},pathContext:{slug:"/projects/pd-spellbook",p:"35675e68f4b5af7b995d9205ad0fc43842f16450"}}}});
